CREATE TABLE IF NOT EXISTS coefficients (
    id INTEGER PRIMARY KEY AUTOINCREMENT,
    d0dr REAL NOT NULL,
    r20 REAL NOT NULL,
    r30 REAL NOT NULL,
    r40 REAL NOT NULL,
    r50 REAL NOT NULL,
    r60 REAL NOT NULL,
    r70 REAL NOT NULL,
    r80 REAL NOT NULL,
    r90 REAL NOT NULL,
    r100 REAL NOT NULL
);

CREATE TABLE IF NOT EXISTS e0_values (
    d0r50 REAL NOT NULL,
    e0 INTEGER NOT NULL,
    PRIMARY KEY(d0r50)
);


